import React from 'react';

const NavbarContainer = styled.nav`
    width: 100%;
    padding: 20px 30px;
    box-sizing: border-box;
    position: fixed;
    z-index: 9999;
    background-color: #fff;
    box-shadow: 0.5px 0.5px 5px gray;
`;
const Navbar = () => {
  return (
    <NavbarContainer>
        <div>
            <NavLink to="/">Home</NavLink>
            <NavLink to="/about">Link1</NavLink>
            <NavLink to="/link2">Link2</NavLink>
            <NavLink to="/link3" className="right">Link3</NavLink>
        </div>
        <div>
            <div className="top">
                <div className="title">
                    <a href="#">Gourmet au Catering</a>
                    <div className="top_menu">
                        <a href="#section1" className="go_about">About</a>
                        <a href="#section2" className="go_menu">Menu</a>
                        <a href="#section3" className="go_contact">Contact</a>
                    </div>
                </div>
            </div>
        </div>
    </NavbarContainer>
  );
};

export default Navbar;
